import React from 'react'

const time = () => {
  return (
    <div className='hidden md:flex justify-center item-center gap-2 text-white'>
        <p className='num text-4xl tracking-wide font-medium'>1:08</p>
        <div className='flex flex-col'>
          <p className='text-xs font'>pm</p>
          <p className='text-xs'>September</p>
        </div>
    </div>
  )
}

export default time
